import React from "react";
import Stack from '@mui/material/Stack';
import cube from './Images/Cube.png';
import './Organization.css'
function OrgMaster(){
    return(
        <div>
            <p style={{textAlign: 'center'}}>May Realities, Inc.</p>
            <OrgData/>
            <TeamData/>
            <TeamMessages/>
        </div>
    )
}
function OrgData(){
    return(
        <div>
            <p style={{textAlign: 'center'}}>Plan: <i>Enterprise</i></p>
            <p style={{textAlign: 'center'}}>Next Billing Date: 12/9/2021</p>
            <p style={{textAlign: 'center'}}>9 Administrators</p>
        </div>
    )
}
function TeamData(){
    return(
        <div>
            <Stack direction="row" spacing={2} justifyContent="center" alignItems="center">
            <img src={cube} alt="Profile" className="profilePicture"></img><p style={{textAlign: 'center'}}>Team Member 1</p>
            <img src={cube} alt="Profile" className="profilePicture"></img><p style={{textAlign: 'center'}}>Team Member 2</p>
            </Stack>
            <Stack direction="row" spacing={2} justifyContent="center" alignItems="center">
            <img src={cube} alt="Profile" className="profilePicture"></img><p style={{textAlign: 'center'}}>Team Member 3</p>
            <img src={cube} alt="Profile" className="profilePicture"></img><p style={{textAlign: 'center'}}>Team Member 4</p>
            </Stack>
            <Stack direction="row" spacing={2} justifyContent="center" alignItems="center">
            <img src={cube} alt="Profile" className="profilePicture"></img><p style={{textAlign: 'center'}}>Team Member 5</p>
            <img src={cube} alt="Profile" className="profilePicture"></img><p style={{textAlign: 'center'}}>Team Member 6</p>
            </Stack>   
        </div>
    )
}
function TeamMessages(){
    return(
        <div className="buttonParent" style={{textAlign: 'center'}}>
            <Stack direction="column" spacing={2} justifyContent="center" alignItems="center">
                <p>Hello</p>
            </Stack>
        </div>
    )
}
export default OrgMaster;
